"use client";



import {  AssetRecordType, Editor, TLComponents, Tldraw,TldrawImage } from '@tldraw/tldraw'
import './index.css'
import React, { useCallback, useState } from 'react'





function CustomActionsMenu() {
  const [selectedImage, setSelectedImage] = useState<string>('');
  
  return (
    <div>
      <select
        name="image"
        value={selectedImage}
        onChange={(e) => {
          setSelectedImage(e.currentTarget.value)
        }}
      >
        <option value="">Select a templet</option>
        <option value= "">Full rink</option>
        <option value= "">Half rink</option>
        <option value= "">Goal zone</option>
      </select>
    </div>
  );
}

const components: TLComponents = {
  ActionsMenu: CustomActionsMenu,
};

export default function App() {
  const handleMount = useCallback((editor: Editor) => {
    //[2]
    const assetId = AssetRecordType.createId();
    const imageWidth = 1200;
    const imageHeight = 675;
    //[2]
    
    
    editor.createAssets([
      {
        id: assetId,
        type: 'image',
        typeName: 'asset',
        props: {
          name: 'tldraw.png',
          src: selectedImage, // You could also use a base64 encoded string here
          w: imageWidth,
          h: imageHeight,
          mimeType: 'image/png',
          isAnimated: false,
        },
        meta: {},
      },
    ]);
  }, []);  

  const selectedImage = ''; // Declare the selectedImage variable

  return (
    <div className="h-full">
      <Tldraw components={components} onMount={handleMount}/>
    </div>
  );
}

